Plurals are a standardized way to deal with quantities. For example, English uses with 2 plurals: "one" (1) and "other" (0, 2, 3, ..). If you have { "items": "{{ count }} items"
} this would produce "1 items", which is incorrect English. This can be solved by defining 2 plural forms: { "items_one": "{{ count }} item", "items_other": "{{ count }} items"
} When providing the count to the t! macro, this will result in: let i18n = use_i18n(); t!(i18n, items, count = || 0) // -> "0 items"
