t!(i18n, items, count = || 4) // -> "4 items" All items_* are merged into the single key items. {{ count }} is a special variable when using plurals. Even if you don't interpolate it, you must supply it: { "items_one": "one item", "items_other": "some items"
} This will still require you to supply the count variable: t!(i18n, items, count = ...).

